import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import "./App.css";

import ListReportComponent from "./components/ListReportComponent";
import FooterComponent from "./components/Layout/FooterComponent"
import CreateReportComponent from "./components/CreateReportComponent";
import UpdateReportComponent from "./components/UpdateReportComponent";
import ViewReportComponent from "./components/ViewReportComponent";

import ListRouteComponent from "./components/ListRouteComponent";
import CreateRouteComponent from "./components/CreateRouteComponent";
import UpdateRouteComponent from "./components/UpdateRouteComponent";
import ViewRouteComponent from "./components/ViewRouteComponent";

import ListFeedbackComponent from "./components/ListFeedbackComponent";
import CreateFeedbackComponent from "./components/CreateFeedbackComponent";
import UpdateFeedbackComponent from "./components/UpdateFeedbackComponent";
import ViewFeedbackComponent from "./components/ViewFeedbackComponent";
import MainNavigation from "./components/Layout/MainNavigation";
import LoginForm from "./components/User/LoginForm";
import RegistrationForm from "./components/User/RegistrationForm";

function App() {
  return (
    <div>
      <Router>
        <div>
          <MainNavigation />
          <div className="container">
            <Switch>

              <Route path="/auth" component={LoginForm}></Route>
              <Route path="/signup" component={RegistrationForm}></Route>

              <Route exact path="/" component={ListReportComponent}></Route>
              <Route path="/reports" component={ListReportComponent}></Route>
              <Route path="/add-report" component={CreateReportComponent}></Route>
              <Route path="/update-report" component={UpdateReportComponent}></Route>
              <Route path="/view-report/:id" component={ViewReportComponent}></Route>

              <Route path="/routes" component={ListRouteComponent}></Route>
              <Route path="/add-route" component={CreateRouteComponent}></Route>
              <Route path="/update-route" component={UpdateRouteComponent}></Route>
              <Route path="/view-route/:id" component={ViewRouteComponent}></Route>

              <Route path="/feedbacks" component={ListFeedbackComponent}></Route>
              <Route path="/add-feedback" component={CreateFeedbackComponent}></Route>
              <Route path="/update-feedback" component={UpdateFeedbackComponent}></Route>
              <Route path="/view-feedback/:id" component={ViewFeedbackComponent}></Route>

            </Switch>
          </div>
          <FooterComponent />
        </div>
      </Router>
    </div>
  );
}

export default App;
